        return(
            <Preloader />
        )
    }
    return (
        <article>
            <div><img src="https://storge.pic2.me/cm/2560x1440/951/58487259adcd0.jpg" alt="Loading..." className={C.background} />
            </div>
            <div>
                <img src={props.profile.photo.large } alt="" className={C.ava} />

                 desc</div>
        </article>
    )
}


export default ProfileInfo;
